import {useState } from "react";
import './Form.css'


function Form () {    
    
	return (
		<section>
			<form action="">
				<label htmlFor="">First question!</label>
				<select name="" id="">
					<option value="">Option 1</option>
					<option value="">Option 2</option>
				</select>
			</form>
		</section>
	)
}

export default Form;
